story:
[Woman + Stone]
I am jealous of *women* (女) who have fat *stones* (石) on their finger.

kanji with similar meaning: CAREFUL! {羨}; {嫉}

I *surely* smoke *wheat*, keep it a secret.
Do not confuse with {密}

[See {密} and {必}].

[Sling shot prim (No flat line)]
Part of the Kanji for 写真

{写}

[Nothing/without {無} + date (evening + fuck)]

Because of your poor #dancing#, you remain *without* a *date* (an evening fuck).

Be careful of {踊}

[ネkrophilia + Lincoln's Hat]

My ancestor loved *ネ*ko's that wear *Abe Lincoln hats*

Be careful of: Partner {相}
